// HamburgerIcon.js

import React, { useState } from 'react';
import { Navbar, Container, Collapse } from 'react-bootstrap';

const HamburgerIcon = () => {
  const [open, setOpen] = useState(false);

  const handleToggle = () => {
    setOpen(!open);
  };

  return (
    <Navbar bg="white" variant="white">
      <Container>
        <Navbar.Toggle onClick={handleToggle} aria-controls="navbarToggleExternalContent" />
        <Collapse in={open}>
          <div id="navbarToggleExternalContent" className="bg-dark p-4">
            <h5 className="text-body-emphasis h4">Collapsed content</h5>
            <span className="text-body-secondary">Toggleable via the navbar brand.</span>
          </div>
        </Collapse>
      </Container>
    </Navbar>
  );
};

export default HamburgerIcon;
